import React, {Component} from 'react';
import Layout from '../Components/Layout/Layout'

class Index extends Component{
	render(){
		return(
			<Layout>
				<img src="/static/pp.jpg" alt="..." class="rounded-circle img-thumbnail"/>
				<style jsx>
					{
						`{
													.img-thumbnail{
														width:500px;
													}
												}`
					}
				</style>
			</Layout>
		)
	}
}

export default Index;
